import React from 'react';


const FCard = ({topBorder,smallLogo,handle,followers,type,count,numberColor,number,bg,smallText,largeText}) => {
    return(
        <div className='FCard' style={{background:`${topBorder}`}} onMouseOver="this.style.backgroundColor = 'yellow'">
            <div className='borderCard' style={{background:bg}}>
              <div className='smallLogo'>
                <img src={smallLogo}/>
                    <p style={{color:smallText}}>{handle}</p>
              </div>
                <p className='followCount' style={{color:largeText}}> {followers}</p>
                <p className='type' style={{color:smallText}}>{type} </p>
                <div className='direction'>
                <img src={count}/>
                <p style={{color:numberColor}}>{number} Today</p>
                </div>
            </div>
        </div>
    )
}

export default FCard;
